@Внук Ельцина 1) а если коммунизм самая уродливая идеология, то может нацизм разрешить? Он сойдёт, не правда ли?
2) а если вам не нравится ещё какая-то идеология? Может запретить всё что не нравится? К чему это демократия, плюрализм мнений, свобода всех идеологий. Вот в США нет запретов на коммунизм и даже на фашизм. Ужас страна.
3) а чем коммунизм кровав? А скажем либеральная идеология не кровавая? Сколько людей умерло от буржуазных революций, от капиталистического империализма, от либерального рабства в первый век истории США? Тот же геноцид в Руанде - привет последствия колониализма.

