@О, мой царь, позвольте сообщить вам, что вы больны психически, даже в нике как в психушке наряду с Наполеоном)
Что по теме, насилие порождает насилие, в итоге мы имеем оправдание того, что происходило в Одессе и тысячи жертв от войны на донбассе, если для вас это нормально, то мне говорить с вами не о чем, не нужно было вмешиватьмя в дела соседнего братского госсударства, нападая, как крысы, когда у них майдан, тогда не было бы такой ответной реакции, население на Украине по факту такое же, как и в России, там даже национальный вопрос не приплести, с натягом на западную Украину.
В итоге чего добились? даже по вашей версии по защите Русского населения никого так и не защитили, пара областей на донбассе тоже через войну прошла, что бы в итоге повторить судьбу какого нибудь приднестровья или северной Осетии, вы считаете это победой? Я нет, развязанна война в Европе в 21м веке, убийство тысяч людей, настроенная против России Украина и ссора с западом, которая обернувшись санкциями и падением курса рубля вдвое, а так же снижение уровня жизни населения страны в итоге до уровня 2000го года явно того не стоило. Путину надо было уходить в 2008, тогда бы его не то что не трогали, героем бы считали, в итоге он завел себя и страну в такую задницу своими имперскими замашками, что теперь народу это разгребать, самим бы не развалиться((
